import React from 'react';

import { View } from 'react-native';

const App = () => {
  return (
    <View>
      <View
        style={{ backgroundColor: 'silver', width: 100, height: 100 }}
      ></View>
      <View
        style={{ backgroundColor: 'silver', width: 150, height: 150 }}
      ></View>
      <View
        style={{ backgroundColor: 'silver', width: 200, height: 200 }}
      ></View>
    </View>
  );
};

export default App;
